//background image of circuit board
//title with animation
//navbar, home, about, testimonials, contact, portfolio
import React from 'react';

class Title extends React.Component {
  render() {
    return (
      <div>
        <nav>
          <button className="navbtns">HOME</button>
          <button className="navbtns">ABOUT</button>
          <button className="navbtns">TESTIMONIALS</button>
          <button className="navbtns">CONTACT</button>
          <button className="navbtns">PORTFOLIO</button>
        </nav>

        <h1>Santiago Orellana</h1>
        <h3>Full-Stack Web Developer</h3>
      </div>
    );
  }
}
export default Title;
